import React from "react";
import Card from "../../component/Card";
import "./project.css";

function Projects() {
  return (
    <>
      <div className=".project-card-conatiner"></div>
      <div className="card-wrapper">
        <div className="card-first">
          <Card />
          <Card />
        </div>
        <div className="card-first">
          <Card />
          <Card />
        </div>
      </div>
    </>
  );
}

export default Projects;
